};

function App() {
    return (
          <Router>
              <AnimatePresence>
                  <Switch>
                      <Route path='/' exact component={Home}/>
                      <Route path='/test' exact component={HackAnimation}/>
                      <Route path='/about' component={About}/>
                      <Route path='/catalog' exact component={Catalog}/>
                      <Route path='/premium' exact component={Premium}/>
                  </Switch>
              </AnimatePresence>
          </Router>

  );
}

export default App;
